### YamlMime:QSharpType
uid: microsoft.quantum.core.rangeend
name: RangeEnd
type: function
namespace: Microsoft.Quantum.Core
summary: Returnerar det definierade slutvärdet för det angivna intervallet, som inte nödvändigt vis är det sista elementet i sekvensen.
remarks: >-
  Det första elementet i ett intervall uttryck `start`är, dess andra element `start+step`, det tredje elementet `start+step+step`är, osv., `end` tills det skickas.


  Observera att det definierade slutvärdet för ett intervall kan skilja sig från det sista elementet i den sekvens som anges av intervallet; till exempel i intervallet 0... 2.. 5 det sista elementet är 4 men end-värdet är 5.
syntax: 'function RangeEnd (range : Range) : Int'
input:
  content: '(range : Range)'
  types:
  - name: range
    isPrimitive: true
    uid: Range
output:
  content: Int
  types:
  - summary: Det definierade slutvärdet för det angivna intervallet.
    isPrimitive: true
    uid: Int
